import React, { Component } from 'react';
import { Navbar, Container, InputGroup, Form, FormControl, Button } from 'react-bootstrap';
import './TopNav.css';

import ViberIcon from './imgTopNav/viber.svg';
import IgIcon from './imgTopNav/ig.svg';
import FbIcon from './imgTopNav/fb.svg';
import YtIcon from './imgTopNav/yt.svg';

export default class TopNav extends Component {
	render() {
		return (
			<React.Fragment>
				<Navbar className="topNav navbar-expand navbar-dark justify-content-between">
					<Container>
						<Navbar.Text className="textTopNavLeft" inline>
							<a className="ttextTopNavLeft mr-4 telefonTopNav" href="#">
								<img className="mr-3" src={ViberIcon} alt="viber icon" />0800 51 055
							</a>
							<span className="textTopNavLeft">*Besplatni info telefon</span>
						</Navbar.Text>
						<Navbar.Text className="textTopNavRight" inline>
							<a href="#" className="mr-4">
								<img src={FbIcon} alt="viber icon" />
							</a>
							<a href="#" className="mr-4">
								<img src={IgIcon} alt="viber icon" />
							</a>
							<a href="#" className="mr-0">
								<img src={YtIcon} alt=" icon" />
							</a>
						</Navbar.Text>
					</Container>
				</Navbar>
			</React.Fragment>
		);
	}
}
